import Foundation

class LoadFeelingUseCase {
    let feelingRepository: FeelingRepository

    init(feelingRepository: FeelingRepository) {
        self.feelingRepository = feelingRepository
    }

    func call() -> [Feeling] {
        return feelingRepository.getFeelings()
    }
}
